//Hello Opencv.js!

var myCanvas = null, uploadImg = null, myImage = null;
function gui() {
    var { element } = Lab.base.createCanvas(200, 200, 'opencv', '', false);
    myCanvas = element;
    // var ctx = myCanvas.getContext('2d');
    // ctx.fillStyle = 'blue';
    // ctx.fillRect(0, 0, 100, 100);

    //创建图片输入
    //图片超大
    Lab.base.createInput('img', '图片', (url) => {
        uploadImg = new Image();
        uploadImg.src = url;
        uploadImg.onload = () => {

            // myImage = img;
            Lab.ai.getColor(uploadImg);
            //cv读取图像
            var src = cv.imread(uploadImg);
            var dst = new cv.Mat();

            //调整色彩模式
            cv.cvtColor(src, dst, cv.COLOR_RGBA2GRAY, 0);
            //cv显示图像,并把dst写入画布中
            cv.imshow(myCanvas, dst);

            //把canvas的数据加载成为p5.Image类型
            myImage = loadImage(myCanvas.toDataURL());

        };
    })

};

